import React from 'react';
import strawberry from '../images/strawberry.svg'
const Catalog = () => {
    return (
        <>
        <div className=" flex flex-col  justify-center items-center ">
            <div className=" flex bg-pink-cf justify-center items-center rounded-full py-[60px]">
            <span className="text-2xl text-red-200 px-2">More than Faster </span><span><img src={strawberry} alt="strawberry "/></span>
            </div>
        </div>
        </>
    );
};

export default Catalog;
